import React from 'react'
import { FormControl } from '@mui/material';
import { InputLabel } from '@mui/material';

import TextField from '@mui/material/TextField';

export default function NewArticleForm() {
    return (
        <form>

            <TextField
                label="Title"
                variant="standard"
                fullWidth
            />
            
            <br></br>
            <br></br>

            <TextField
                label="Your Content here "
                multiline
                variant = "standard"
                rows={30}
                fullWidth
            />
            
        </form>
    )
}
